import React from "react";
import Navbar from "../Components/Navvbar";
import styles from "./Register.module.css";
import { useState } from "react";
import axios from "axios";

const Register = () => {
    const [name, setName] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();

    }
  return (
    <div className={styles.container}>
      <Navbar />
      <div className={styles.formContainer}>
        <h2 className={styles.title}>Create Your Account</h2>
        <form className={styles.form}>
          <input type="text" placeholder="Username" className={styles.input} onChange={(e) => setName(e.target.value)}/>
          <input type="email" placeholder="Email" className={styles.input} onChange={(e) => setEmail(e.target.value)}/>
          <input type="password" placeholder="Password" className={styles.input} onChange={(e) => setPassword(e.target.value)}/>
          <button type="submit" className={styles.button} onSubmit={handleSubmit}>Register</button>
        </form>
      </div>
    </div>
  );
};

export default Register;
